import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [data, setData] = useState(null);



  return (
    <div className="App">
      <header className="App-header">
      {data ? <p>{data.message}</p> : <p>Loading...</p>}
      </header>
    </div>
  );

}

export default App;
